import React from "react";

import classes from './Croquis.module.css'

function Croquis(props) {
  let forma = null;

  switch (props.respaldo.forma) {
    case "Rectangular":
      forma = (
        <svg
          width="110"
          height="62"
          viewBox="0 0 110 62"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <rect
            x="0.5"
            y="0.5"
            width="108"
            height="61"
            fill="#FFFDFD"
            stroke="#1A1A1A"
          />
        </svg>
      );
      break;
case "Capillar":
        forma = (
            <svg width="110" height="63" viewBox="0 0 110 63" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path d="M0.5 61.75V13.1128C16.3815 4.88015 37.6709 0.749999 58 0.749999C78.3336 0.749998 97.6036 4.88149 109.5 13.0713V61.75H0.5Z" fill="white" stroke="black"/>
            </svg>
        );
        break;
case "Oval":
            forma = (
                <svg width="110" height="63" viewBox="0 0 110 63" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M0.5 61.75V13.1128C16.3815 4.88015 37.6709 0.749999 58 0.749999C78.3336 0.749998 97.6036 4.88149 109.5 13.0713V61.75H0.5Z" fill="white" stroke="black"/>
                </svg>
            );
            break;
case "Puntas Redondeadas":
           forma = (
            <svg width="110" height="62" viewBox="0 0 110 62" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect x="0.5" y="0.5" width="109" height="61" rx="14.5" fill="white" stroke="black"/>
            </svg>
                );
                break;
    default:
        forma =" sin forma "
      break;
  }
  return <div className={classes.Croquis}>

  </div>;
}

export default Croquis;
